<?php

namespace Tests\Unit;


use Exception;
use Hnllyrp\LaravelSupport\Support\Extensions\UploadFile;
use PHPUnit\Framework\TestCase;

/**
 * Class UploadFileTest
 * @example vendor/bin/phpunit tests/Unit/UploadFileTest
 * @package Tests\Unit
 */
class UploadFileTest extends TestCase
{

    public function testApi()
    {
        // 模拟请求数据
        $request = request();

        $file = 'data:image/png;base64,';
        $request->offsetSet('file', ['content' => $file]);

        $user_id = 1;

        // 测试开始
        $type = $request->input('type', 'image'); // 上传类型 : image、video

        /**
         * 功能：文件上传，支持file文件和base64字符串上传
         * file类型：支持单一文件上传
         * base64类型：支持多文件上传
         */
        $savePath = 'uploads/' . $type . '/';

        try {
            $urls = UploadFile::api_upload($savePath, $type, $user_id);
        } catch (Exception $e) {

            dd($e->getMessage());
            // return $this->failed($e->getMessage() ?? 'upload fail');
        }

        foreach ($urls as $key => $url) {
            $urls[$key] = get_image_path($url);
        }

        dd($urls);
        // $this->assertTrue(true);
    }





}
